float chrGetDistanceToCoord(struct chrdata *chr, struct coord *coord)
{
	float xdiff = coord->x - chr->pos->coord.x;
	float ydiff = coord->y - chr->pos->coord.y;
	float zdiff = coord->z - chr->pos->coord.z;

	return sqrtf(xdiff * xdiff + ydiff * ydiff + zdiff * zdiff);
}

float chrGetLateralDistanceToCoord(struct chrdata *chr, struct coord *coord)
{
	float xdiff = coord->x - chr->pos->coord.x;
	float zdiff = coord->z - chr->pos->coord.z;

	return sqrtf(xdiff * xdiff + zdiff * zdiff);
}

float chrGetLateralDistanceToPad(struct chrdata *chr, s32 pad_id)
{
	struct position *pos = chr->pos;
	float xdiff, zdiff;
	struct pad pad;
	float distance = 0;
	pad_id = padResolve(chr, pad_id);

	if (pad_id >= 0) {
		padUnpack(pad_id, 2, &pad);
		xdiff = pad.coord.x - pos->coord.x;
		zdiff = pad.coord.z - pos->coord.z;
		distance = sqrtf(xdiff * xdiff + zdiff * zdiff);
	}

	return distance;
}

float chrGetSquaredDistanceToCoord(struct chrdata *chr, struct coord *coord)
{
	float xdiff = coord->x - chr->pos->coord.x;
	float ydiff = coord->y - chr->pos->coord.y;
	float zdiff = coord->z - chr->pos->coord.z;

	return xdiff * xdiff + ydiff * ydiff + zdiff * zdiff;
}

float coordGetSquaredDistanceToCoord(struct coord *a, struct coord *b)
{
	float xdiff = a->x - b->x;
	float ydiff = a->y - b->y;
	float zdiff = a->z - b->z;

	return xdiff * xdiff + ydiff * ydiff + zdiff * zdiff;
}

s32 func0f0495d0(struct chrdata *chr, s32 pad_id)
{
	s32 ret = -1;
	s32 pad_id_backup = pad_id;
	struct pad pad;

	if (pad_id >= 10000) {
		s32 resolved_pad_id = padResolve(chr, pad_id - 10000);

		if (resolved_pad_id >= 0) {
			padUnpack(resolved_pad_id, 0x40, &pad);
			ret = pad.padnum;
		}
	} else {
		ret = pad_id;
	}

	return ret;
}

s32 padResolve(struct chrdata *chr, s32 pad_id)
{
	if (pad_id == 9000) {
		pad_id = chr->padpreset1;
	}

	return pad_id;
}

